import React from 'react';

function LoginConfirmation(props) {
    return (

        <div>
            {props.userAccount.map(userAccount => {
                let usernameIDK = userAccount.username;
                let passwordIDK = userAccount.password;

                if(props.username === usernameIDK){

                return(
                    <div>
                        <div name="usernameMap" value={props.cred.usernameIDK} onLoad={props.inputChanged}></div>
                        <div name="passwordMap" value={props.cred.passwordIDK} onLoad={props.inputChanged}></div>
                    </div>
                );
                }
            })}
        </div>
    );
}

export default LoginConfirmation;
